package com.fr.bi.manager;/** * Created by Hiram on 2015/3/20. */public class LocalAdrrBean {    long startTime;    private String localAddr;    public LocalAdrrBean(String localAddr, long startTime) {        this.localAddr = localAddr;        this.startTime = startTime;    }    public String getLocalAddr() {        return localAddr;    }    public void setLocalAddr(String localAddr) {        this.localAddr = localAddr;    }    public long getStartTime() {        return startTime;    }    public void setStartTime(long startTime) {        this.startTime = startTime;    }}